                <Switch>
                    <Route exact path="/">
                        <Inicio />
                    </Route>
                    <Route path="/galeria">
                        <Galeria />
                    </Route>
                    <Route path="/servicios">
                        <Servicios />
                    </Route>
                </Switch>

            </Router>
        </div>
    );
}

